import { Outlet, NavLink } from 'react-router-dom';
import { Suspense } from 'react';
import { NavBar, NavItem, Header } from './Layout.styled';

const Layout = () => {
  return (
    <>
      <main>
        <Suspense fallback={<div>Loading...</div>}>
          <Outlet />
        </Suspense>
      </main>
    </>
  );
};

export default Layout;
